import About from './About';
const divStyle = {
  marginLeft: 400,
  marginRight: 400,
}

const layoutStyle = {

  padding: 20,
  border: '1px solid #DDD',
  height: 400,
};

const AboutLayout = props => (
  <div style={layoutStyle}>
    <div style={layoutStyle}>
      <About />
      {props.children}
    </div>
  </div>
);

export default AboutLayout;
